import React from 'react'
import { HeaderSecretariaDC, ClienParticular, ClienCorporativo } from '../../Components'
import Button from 'react-bootstrap/Button'
import Link from 'react-router-dom'
import Container from 'react-bootstrap/Container';

const Clientes = () => {
    return (
        <>
            <HeaderSecretariaDC />
            <Button onSubmit={<ClienParticular />} variant="primary">Primary</Button>
            <Container className="mr-50 ml-50">
            <h2> Nuevo Cliente Particular </h2>
            {/* <ClienParticular /> */}
            <h2> Nuevo Cliente Corporativo </h2>
            <ClienCorporativo />
            </Container>
        </>
    )
}

export default Clientes
